import React from "react";

function Raffle() {
  const lotteryNumbers = [1, 9, 27, 32, 44, 48];
  
  return (
    <div className="about">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
            <p>These are your lottery numbers:</p>
            <ul>
              {lotteryNumbers.map((number) => (
                <li key={number}>{number}</li>
              ))}
            </ul>
          </div>
          <div class="col-lg-5">
            <h1 class="font-weight-light"> Raffle</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Raffle;
